import React, { Component } from 'react';

class RepoList extends Component {

  render() {
    return (
      <div>
        <ul>
          {
            this.props.userRepos.map(repo => {
              return <Repo
                        repo={repo}
                        key={repo.id}
                        {...this.props} />
            })
          }
        </ul>
      </div>
    )
  }
}

export default RepoList;
